import React from "react";
import { Container, CssBaseline, Typography } from "@material-ui/core";

const Home = () => {
  return (
    <>
      <CssBaseline />
      <Container maxWidth="sm">
        <Typography component="div" style={{ backgroundColor: "#cfe8fc" }}>
          <h1>Home </h1>
        </Typography>
      </Container>
    </>
  );
};

export default Home;
